    public static function fromJulianDay($julianDay) {
        $d = floor($julianDay + 0.5);
        $f = $julianDay + 0.5 - $d;
        if ($d >= 2299161) {
            $c = floor(($d - 1867216.25) / 36524.25);
            $d += 1 + $c - floor($c / 4);
