        $f *= 24;
        $hour = floor($f);
        $f -= $hour;
        $f *= 60;
        $minute = floor($f);
        $f -= $minute;
        $f *= 60;
        $second = round($f);
        if ($second > 59) {
            $second -= 60;
            $minute++;
        }
        if ($minute > 59) {
            $minute -= 60;
            $hour++;
