        }

        $g = $yearGanIndex;
        $z = $yearZhiIndex;

        $gExact = $yearGanIndex;
        $zExact = $yearZhiIndex;

        $solarYear = $solar->getYear();
        $solarYmd = $solar->toYmd();
        $solarYmdHms = $solar->toYmdHms();

        $liChun = $o['jieQi']['立春'];
