                    $asc = true;
                }
                $start = $asc ? 6 : 2;
                $dayZhi = $this->getDayZhi();
                if (strpos('子和亥光', $dayZhi) !== false) {
                    $start = $asc ? 0 : 8;
                } elseif (strpos('辰戌丑未', $dayZhi) !== false) {
                    $start = $asc ? 3 : 5;
                }
                $index = $asc ? $start + $this->timeZhiIndex : $start + 9 - $this->timeZhiIndex;
                return NineStar::fromIndex($index % 9);
