            public function _buildJieQi($name, $solar)
            {
                $jie = false;
                $qi = false;
                $i=null;
                $j=null;
                for ($i = 0, $j = count(Lunar::$JIE_QI); $i < $j; $i++) {
                    if (Lunar::$JIE_QI[$i] === $name) {
                        if ($i % 2 === 0) {
                            $qi = true;
                        } else {
                            $jie = true;
                        }
                        break;
                    }
                }
                return new class ($name, $solar, $jie, $qi) {
                    private $name, $solar, $jie, $qi;
                    public function __construct($name, $solar, $jie, $qi)
                    {
