                $name = $jieQi->getName();
                $offset = 0;

                for ($i = 0, $j = count(Lunar::$JIE_QI); $i < $j; $i++) {
                    if ($name === Lunar::$JIE_QI[$i]) {
                        $offset = $i;
                        break;
                    }
